  (function() {
  function identifySpeaker() {
    const elements = document.getElementsByClassName('group');
    const messages = [];
    const speakers = {
      BONEZ: [],
      MUFFINS: []
    };
  
    for (let i = 0; i < elements.length; i++) {
      const element = elements[i];
      const bgClass = element.classList.contains('bg-gray-50') ? 'bg-gray-50' : 'dark:bg-gray-800';
      const pElement = element.querySelector('.prose > p');
      
      let text = '';
      let speaker = '';
  
      if (pElement) {
        text = pElement.innerText.trim();
        speaker = 'BONEZ';
      } else {
        const userDiv = document.evaluate(
          './/div[contains(@class, "min-h-")]/text()',
          element,
          null,
          XPathResult.STRING_TYPE,
          null
        ).stringValue.trim();
        
        if (userDiv) {
          text = userDiv;
          speaker = 'MUFFINS';
        }
      }
  
      if (text) {
        messages.push({ speaker, text });
        speakers[speaker].push(text);
      }
    }
  
    return { messages, speakers };
  }
  
  let chatData;
  chatData = identifySpeaker();

  // Create the HTML code for the chat messages
  let htmlContent = `
  <!DOCTYPE html>
  <html lang="en">
  <head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Chat Messages</title>
    <style>
    body {
      background-image: url(data:image/gif;base64,);
      background-repeat: repeat;
      display: flex;
      align-items: center;
      justify-content: center;
      height: 100vh;
      margin: 0;
      padding: 0;
      box-sizing: border-box;
      }
  
      .container {
      display: flex;
      flex-direction: column;
      align-items: flex-start;
      width: auto;
      padding-top: 5em;
      height: 100%;
      overflow-y: auto;
      scrollbar-color: transparent transparent;
      overflow: visible;
      }
      
  
      .user-box-bonez {
      background-color: rgb(73, 240, 240);
      padding-left: 1em;
      padding-right: 2em;
      border-radius: 2px;
      font-family: 'Courier New', Courier, monospace;
    }
    .user-box-muffins {
      background-color: rgb(228, 137, 231);
      padding-left: 1em;
      padding-right: 2em;
      border-radius: 2px;
      font-family: 'Courier New', Courier, monospace;
    }
    
  .chat-message-bonez,
  .chat-message-user {
    display: flex;
    align-items: center;
    margin-bottom: 0;
    padding: 1em;
    max-width: 40em;
  }
  
  .avatar {
    width: 60px;
    height: 60px;
    margin-right: 1em;
    border-radius: 2px;

  }

  .message-content {
    margin-top: 0;
    margin-bottom: 0;
  }
  
  .sender-name {
    font-size: 1em;
    font-weight: bolder;
    margin-bottom: 0;
  }
  
  .message-text {
    padding: none;
    margin-top: 5px;
  }
    </style>
  </head>
  <body>
    <div class="container">
  `;

  // Iterate through the chat messages and create the message divs
  for (const message of chatData.messages) {
    const { speaker, text } = message;
    const divClass = speaker === 'BONEZ' ? 'chat-message-bonez' : 'chat-message-user';
    const userBox = speaker === 'BONEZ' ? 'user-box-bonez' : 'user-box-muffins';
    const bonezAvatar = "data:image/jpeg;base64,"
    const muffinsAvatar = "data:image/jpeg;base64,"
    const avatar = speaker === 'BONEZ' ? bonezAvatar : muffinsAvatar;
    htmlContent += `
      <div class="${divClass}">
        <img class="avatar" src="${avatar}">
        <div class="${userBox}">
          <p class="sender-name">${speaker}</p>
          <p class="message-text">${text}</p>
        </div>
      </div>
    `;
  }

  // Complete the HTML code
  htmlContent += `
    </div>
  </body>
  </html>
  `;

  // Open a new window and inject the HTML code
  const newWindow = window.open();
  newWindow.document.open();
  newWindow.document.write(htmlContent);
  newWindow.document.close();
  })();